import React, {useEffect} from 'react'

const Profile = ()=>{
    useEffect(()=>{
        fetch('/mypost',{
            headers:{
                "Authorization": "Bearer " + localStorage.getItem("jwt")
            }
        })
        .then(res=>res.json())
        .then(result=>{
            console.log(result)
        })
    },[])

    return(
        <div style={{maxWidth:"550px", margin:"0px auto"}}>
            <div style={{
                    display: "flex",
                    justifyContent:"space-around",
                    margin:"18px 0px",
                    borderBottom: "1px solid grey"
                }}>
                <div >
                    <img style={{
                        width: "150px", 
                        height:"150px", 
                        borderRadius:"75px"
                    }}
                    src="images/hoodwink.png"/>
                </div>
                <div>
                    <h4>Hoodwink</h4>

                    <div style={{display:"flex", justifyContent:"space-between", width:"106%"}}>
                        <h6>1 posts</h6>
                        <h6>1 followers</h6>
                        <h6>1 following</h6>
                    </div>

                </div>
            </div>
        
            <div className="gallery">
                <img className="item" src="images/hoodwink.png"/>
                <img className="item" src="images/hoodwink.png"/>
                <img className="item" src="images/hoodwink.png"/>

            </div>
        </div>
    )
}

export default Profile
